import numpy as np
import json
from plots.config_rcparams import *

# Matrix of this example
# AMat={{0.1241I, -0.879Exp[0.412I], 0.321Exp[-0.012I], 0.96Exp[0.009I], -0.003Exp[-1.5I]},
