""" Import determining matrix generated with Mathematica """
path = "C:/Users/thivi/Documents/GitHub/koopman-kuramoto/symbolic/symmetries/determining_matrices/"
with open(path+"ReImDetMatrix_N5_d2_pm2_3_sink.json", "r") as file:
    json_data = json.load(file)
json_array = np.array(json_data)  # Shape: (rows, cols, 2)


""" Combine the real and imaginary parts into the determining matrix """
calD = json_array[..., 0] + 1j*json_array[..., 1]
plot_singvals = False
plot_singvecs = False

""" SVD to extract singular vectors related to zero singular values """
U, S, Vh = np.linalg.svd(calD, full_matrices=True)
# plt.matshow(np.real(np.conjugate(Vh.T)), aspect="auto")
# plt.matshow(np.imag(np.conjugate(Vh.T)), aspect="auto")
# plt.show()
v1 = np.conjugate(Vh.T)[:, -4]
v2 = np.conjugate(Vh.T)[:, -3]
v3 = np.conjugate(Vh.T)[:, -2]
v4 = np.conjugate(Vh.T)[:, -1]


""" Known symmetries """
# L0_singvec =
# calK_singvec =

""" Ensure that the vectors are indeed singular vectors """
zero_array = np.array(np.zeros(len(calD[:, 0])))
for vec in [v1, v2, v3, v4]:  # L0_singvec.T]:
    print(np.allclose(calD@vec, zero_array, rtol=1e-14, atol=1e-14))
# print(np.allclose(calD@calK_singvec.T, zero_array + zero_array*1 I, rtol=1e-6, atol=1e-6))


# Function to map near-zero complex numbers to 0 and format for Mathematica
def format_complex_number(z):
    # Check if both real and imaginary parts are effectively zero
    if abs(z.real) < 1e-5 and abs(z.imag) < 1e-5:
        return "0"
    else:
        # Format with 5 digits for real and imaginary parts
        return f"{z.real:.5f}+{z.imag:.5f}I" if z.imag >= 0 else f"{z.real:.5f}{z.imag:.5f}I"


# Convert each float to a string with 5 digits (not in scientific notation)
v1_list = [format_complex_number(x) for x in v1]
v2_list = [format_complex_number(y) for y in v2]
v3_list = [format_complex_number(z) for z in v3]
v4_list = [format_complex_number(w) for w in v4]

# Join the elements with commas
v1_list = ", ".join(v1_list)
v2_list = ", ".join(v2_list)
v3_list = ", ".join(v3_list)
v4_list = ", ".join(v4_list)

print(v1_list, "\n\n", v2_list, "\n\n", v3_list, "\n\n", v4_list)

# print(L0_singvec.T@calK_singvec) # => they are linearly independent
# qL = L0_singvec@subV
# print(qL)
# qK = calK_singvec@subV
# print(qK)
